const TagsList = ({ items, onItemSelect }) => {
  return (
    <div className="tags-side-bar">
      <p>Popular Tags</p>
      <div className="tag-list">
        {items.map((item) => (
          <Link>{item}</Link>
        ))}
      </div>
    </div>
  );
};

export default TagsList;
